import { VBtn } from 'vuetify/lib'

export default {
  extends: VBtn,
  props: {
    small: {
      type: Boolean,
      default: true,
    },
    depressed: {
      type: Boolean,
      default: true,
    },
    color: {
      type: String,
      default: 'primary white--text',
    },
    minWidth: {
      type: Number,
      default: 120,
    },
  },
}
